        private async void btnCreateImg_Click2(object sender, RoutedEventArgs e)
        {
            try
            {
                String binarySFormated = txtBinary.Text.Replace("\r", "").Replace(" ", "").Replace("\n", "");

                String sBits = getTagFromSelectedRadioButton(spRBcChannel);
                if (sBits == null) return;
                Int32 iBits = Convert.ToInt32(sBits);

                // Calculamos el width en función de los bits elegidos por canal de color            
                Int32 w = 0;
                Int32 h = 0;

                // y la dependepndia de tener seleccionado el ancho en función de la raiz cuadrada o
                // un ancho específico
                if (cbSquareRootWidth.IsChecked.HasValue && cbSquareRootWidth.IsChecked.Value)
                {
                    Int32 wh = (Int32)Math.Sqrt(binarySFormated.Length / (iBits * 4));

                    if (wh < 1) return;

                    w = wh;
                    h = wh;
                }
                else
                {
                    try
                    {
                        Int32 sW = Convert.ToInt32(txtWidth.Text);
                        w = sW;
                        h = (binarySFormated.Length / (iBits * 4) / w);

                        if (h < 1) return;
                    }
                    catch (Exception ex) { return; }
                }


                Color[,] matrix = null;

                String REPRESENTATIONalgoritm = getTagFromSelectedRadioButton(spRBRepresentation);
                switch (REPRESENTATIONalgoritm)
                {
                    case "N1":
                        matrix = NORMALMatrixFromBinaryStringXBitsColor(binarySFormated, iBits, w, h);
                        break;

                    case "N2":
                        matrix = NEXTMatrixFromBinaryStringXBitsColor(binarySFormated, iBits, w, h);
                        break;

                    case "S1":
                        matrix = SPIRAL01MatrixFromBinaryStringXBitsColor(binarySFormated, iBits, w, h);
                        break;

                    case "S2":
                        matrix = SPIRAL02MatrixFromBinaryStringXBitsColor(binarySFormated, iBits, w, h);
                        break;

                }

                if (matrix == null) return;

                _bitmap = WBitmapFromMATRIX(matrix);
                imgMAIN.Source = _bitmap;
            }
            catch (Exception ex)
            {
                return;
            }

        }

        private String getTagFromSelectedRadioButton(StackPanel sp)
        {            
            foreach (UIElement e in sp.Children)
            {
                if(e is RadioButton)
                {
                    RadioButton radioButton = (RadioButton)e;

                    if(radioButton.IsChecked.HasValue && radioButton.IsChecked.Value)
                    {
                        return (String)radioButton.Tag;
                    }

                }
            }

            return null;
        }

