        private byte[] ConvertBitmapToByteArray(WriteableBitmap bitmap)
        {
            using (Stream stream = bitmap.PixelBuffer.AsStream())
            using (MemoryStream memoryStream = new MemoryStream())
            {
                stream.CopyTo(memoryStream);
                return memoryStream.ToArray();
            }
        }

        private async void btnViewImg_Click(object sender, RoutedEventArgs e)
        {
            byte[] ba = ConvertBitmapToByteArray(_bitmap);
            Int32 w = _bitmap.PixelWidth;
            Int32 h = _bitmap.PixelHeight;
            var view = CoreApplication.CreateNewView();
            int id = 0;
            await view.Dispatcher.RunAsync(CoreDispatcherPriority.Normal, () =>
            {
                var frame = new Frame();
                frame.DataContext = new TransferWBitmap() { 
                    Width = w, Heiht = h, Data = ba };
                frame.Navigate(typeof(ViewPage), null);
                Window.Current.Content = frame;                
                Window.Current.Activate();
                id = ApplicationView.GetForCurrentView().Id;
            });

            await ApplicationViewSwitcher.TryShowAsStandaloneAsync(id);
        }

        private async void btnSaveImg_Click(object sender, RoutedEventArgs e)
        {
            var savePicker = new Windows.Storage.Pickers.FileSavePicker();
            savePicker.SuggestedStartLocation =
                Windows.Storage.Pickers.PickerLocationId.PicturesLibrary;
            // Dropdown of file types the user can save the file as
            savePicker.FileTypeChoices.Add("Png files", new List<string>() { ".png" });
            savePicker.FileTypeChoices.Add("Jpg files", new List<string>() { ".jpg" });
            savePicker.FileTypeChoices.Add("Bmp files", new List<string>() { ".bmp" });
            // Default file name if the user does not type one in or select a file to replace
            savePicker.SuggestedFileName = "NewSaveImage";

            Windows.Storage.StorageFile file = await savePicker.PickSaveFileAsync();

            if (file != null)
            {
                String[] extensionTemp = file.Name.Split('.');

                String fileExtension = extensionTemp[extensionTemp.Length - 1].ToLower();

                using (IRandomAccessStream stream = await file.OpenAsync(FileAccessMode.ReadWrite))
                {
                    BitmapEncoder encoder = await BitmapEncoder.CreateAsync(
                        fileExtension == "jpg" ? BitmapEncoder.JpegEncoderId :
                        fileExtension == "png" ? BitmapEncoder.PngEncoderId :
                        fileExtension == "bmp" ? BitmapEncoder.BmpEncoderId : BitmapEncoder.JpegEncoderId
                        , stream);
                    Stream pixelStream = _bitmap.PixelBuffer.AsStream();
                    byte[] pixels = new byte[pixelStream.Length];
                    await pixelStream.ReadAsync(pixels, 0, pixels.Length);
                    encoder.SetPixelData(BitmapPixelFormat.Rgba8, BitmapAlphaMode.Straight,
                                        (uint)_bitmap.PixelWidth,
                                        (uint)_bitmap.PixelHeight,
                                        96.0,
                                        96.0,
                                        pixels);
                    await encoder.FlushAsync();
                }
            }
        }

