        private async Task<WriteableBitmap> ProcessImageAsync(StorageFile file, uint width, uint height)
        {
            RandomAccessStreamReference random = RandomAccessStreamReference.CreateFromFile(file);
            using (IRandomAccessStream stream = await random.OpenReadAsync())
            {
                //Create a decoder for the image
                var decoder = await BitmapDecoder.CreateAsync(stream);

                //Initialize bitmap transformations to be applied to the image.
                var transform = new BitmapTransform() { ScaledWidth = width, ScaledHeight = height, InterpolationMode = BitmapInterpolationMode.Cubic };

                //Get image pixels.
                var pixelData = await decoder.GetPixelDataAsync(BitmapPixelFormat.Bgra8, BitmapAlphaMode.Premultiplied, transform, ExifOrientationMode.RespectExifOrientation, ColorManagementMode.ColorManageToSRgb);
                var pixels = pixelData.DetachPixelData();

                //Initialize writable bitmap.
                var wBitmap = new WriteableBitmap((int)decoder.PixelWidth, (int)decoder.PixelHeight);
                await wBitmap.SetSourceAsync(stream);

                return wBitmap;
            }
        }

        private static WriteableBitmap WBitmapFromMATRIX(Color[,] matrix)
        {
            int width = matrix.GetLength(0);
            int height = matrix.GetLength(1);

            WriteableBitmap bitmap = new WriteableBitmap(width, height);
                        
            using (Stream stream = bitmap.PixelBuffer.AsStream())
            {
                for (int y = 0; y < height; y++)
                {
                    for (int x = 0; x < width; x++)
                    {
                        //stream.WriteByte(matrix[x, y].A);
                        //stream.WriteByte(matrix[x, y].B);
                        //stream.WriteByte(matrix[x, y].G);
                        //stream.WriteByte(matrix[x, y].R);
                        
                        stream.WriteByte(matrix[x, y].B);
                        stream.WriteByte(matrix[x, y].G);
                        stream.WriteByte(matrix[x, y].R);
                        stream.WriteByte(matrix[x, y].A);
                    }
                }
            }

            return bitmap;         
        }

        public static Color[,] NORMALMatrixFromBinaryStringXBitsColor(string binaryString, Int32 bits, Int32 w, Int32 h)
        {
            double increment = 255 / (Math.Pow(2, bits) - 1);
            Color[,] matrix = new Color[w, h];

            int x = 0;
            int y = 0;

            for (int i = 0; i + (bits * 4) <= binaryString.Length; i += (bits * 4))
            {
                // convertir el carácter de la cadena binaria a byte
                Color value = Color.FromArgb(
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + (bits * 3), bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i, bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + bits, bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + (bits * 2), bits), 2) * increment));

                matrix[x, y] = value;
                x++;

                if (x < 0 || x > w - 1)
                {
                    x = 0;
                    y++;

                    if (y > h - 1)
                    {
                        return matrix;
                    }

                }

            }
            return matrix;
        }

        public static Color[,] NEXTMatrixFromBinaryStringXBitsColor(string binaryString, Int32 bits, Int32 w, Int32 h)
        {
            double increment = 255 / (Math.Pow(2, bits) - 1);

            Color[,] matrix = new Color[w, h];

            int x = 0;
            int y = 0;

            Boolean derecha = true;
            for (int i = 0; i + (bits * 4) <= binaryString.Length; i += bits * 4)
            {
                // convertir el carácter de la cadena binaria a byte
                Color value = Color.FromArgb(
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + (bits * 3), bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i, bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + bits, bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + (bits * 2), bits), 2) * increment));

                matrix[x, y] = value;

                if (derecha)
                {
                    x++;
                }
                else
                {
                    x--;
                }
                if (x < 0 || x > w - 1)
                {
                    if (derecha)
                    {
                        x--;
                    }
                    else
                    {
                        x++;
                    }

                    derecha = !derecha;
                    y++;

                    if(y > h - 1)
                    {
                        return matrix;
                    }

                }

            }
            return matrix;
        }

        public static Color[,] SPIRAL01MatrixFromBinaryStringXBitsColor(string binaryString, Int32 bits, Int32 w, Int32 h)
        {
            double increment = 255 / (Math.Pow(2, bits) - 1);

            Color[,] matrix = new Color[w, h];
                        
            // posición del centro de la matriz
            int x = (w / 2);
            int y = (h / 2);

            Boolean cambio = false;
            int iMas = 0;
            int iMAX = 1;
            Int32 direccion = 0;
            for (int i = 0; i + (bits * 4) <= binaryString.Length; i += bits * 4)
            {
                // convertir el carácter de la cadena binaria a byte
                Color value = Color.FromArgb(
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + (bits * 3), bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i, bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + bits, bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + (bits * 2), bits), 2) * increment)
                    );

                // asignar el valor a la posición actual

                Int32 xTemp = (x < w) ? (x) : (w - 1);
                Int32 yTemp = (y < h) ? (y) : (h - 1);

                xTemp = (xTemp > -1) ? (xTemp) : 0;
                yTemp = (yTemp > -1) ? (yTemp) : 0;

                matrix[xTemp, yTemp] = value;

                if (iMas == iMAX)
                {
                    direccion++;
                    iMas = 0;
                    if (direccion == 4)
                    {
                        direccion = 0;
                    }

                    if (cambio)
                    {
                        iMAX++;
                    }
                    cambio = !cambio;
                }

                if (direccion == 0)
                {
                    x++;
                }
                else if (direccion == 1)
                {
                    y--;
                }
                else if (direccion == 2)
                {
                    x--;
                }
                else if (direccion == 3)
                {
                    y++;
                }

                
                iMas++;
            }

            return matrix;
        }

        public static Color[,] SPIRAL02MatrixFromBinaryStringXBitsColor(string binaryString, Int32 bits, Int32 w, Int32 h)
        {
            double increment = 255 / (Math.Pow(2, bits) - 1);

            Color[,] matrix = new Color[w, h];

            // posición del centro de la matriz
            int x = 0;
            int y = 0;

            Int32 xInit = 0;
            Int32 yInit = 1;
            Int32 wOffset = w;
            Int32 hOffset = h;
            Int32 direccion = 0;
            for (int i = 0; i + (bits * 4) <= binaryString.Length; i += bits * 4)
            {
                // convertir el carácter de la cadena binaria a byte
                Color value = Color.FromArgb(
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + (bits * 3), bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i, bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + bits, bits), 2) * increment),
                    (Byte)(Convert.ToInt32(binaryString.Substring(i + (bits * 2), bits), 2) * increment));

                // asignar el valor a la posición actual
                
                matrix[x, y] = value;
                
                if (direccion == 0)
                {
                    x++;
                }
                else if (direccion == 1)
                {
                    y++;
                }
                else if (direccion == 2)
                {
                    x--;
                }
                else if (direccion == 3)
                {
                    y--;
                }

                if ((direccion == 2 && x < xInit) || (direccion == 3 && y < yInit) || (direccion == 0 && x >= wOffset) || (direccion == 1 && y >= hOffset))
                {                    
                    if (direccion == 2 && x < xInit)
                    {
                        x++;
                        y--;
                        xInit++;
                    }
                    else if (direccion == 3 && y < yInit)
                    {
                        y++;
                        x++;
                        yInit++;
                    }
                    else if (direccion == 0 && x >= wOffset)
                    {
                        x--;
                        y++;
                        wOffset--;
                    }
                    else if (direccion == 1 && y >= hOffset)
                    {
                        y--;
                        x--;
                        hOffset--;
                    }

                    direccion++;
                    if (direccion == 4)
                    {
                        direccion = 0;
                    }
                }

                
            }

            return matrix;
        }

